// Main input object
const data = items[0].json;

// Step 1: Normalize eventDescription formatting
let desc = data.eventDescription || "";

// Replace line breaks and <br> tags with real newlines
desc = desc.replace(/<br\s*\/?>/gi, '\n').replace(/\r\n|\r/g, '\n');

// Remove markdown links like [label](url) → just keep the URL
desc = desc.replace(/\[([^\]]+)\]\((https?:\/\/[^\)]+)\)/gi, '$2');

// === Helper function to extract fields ===
const extract = (label) => {
  const regex = new RegExp(`${label}:\\s*(.*?)(\\n|$)`, 'i');
  const match = desc.match(regex);
  if (!match) return null;

  let value = match[1].trim();

  // Clean up common unwanted text (e.g., [null], [Missing])
  value = value.replace(/\[.*?\]/g, '').trim();
  return value.length > 0 ? value : null;
};

// === Validations ===
const validateCompany = (val) => val && /^[A-Za-z0-9&()\-'.\s]{2,}$/.test(val);
const validateWebsite = (val) => val && /^https?:\/\/[^\s]+$/i.test(val);
const validateUseCase = (val) => {
  if (!val) return false;
  const lower = val.toLowerCase().trim();
  return !['null', 'missing', ''].includes(lower);
};

// === Extract fields ===
const rawCompany = extract("Company");
const rawWebsite = extract("Website");
const rawUseCase = extract("Use Case");

const company = validateCompany(rawCompany) ? rawCompany : null;
const website = validateWebsite(rawWebsite) ? rawWebsite : null;
const use_case = validateUseCase(rawUseCase) ? rawUseCase : null;

const email = extract("Email");
const subject = extract("Subject");
const industry = extract("Industry");
const meeting_time = extract("Meeting Time");
const meeting_link = extract("Meeting Link");
const contact_name = extract("Contact Name");

// === Final Output ===
return [
  {
    json: {
      // Static from payload
      booking_id: data.bookingId || null,
      meeting_title: data.eventTitle || null,
      meeting_status: data.status || null,
      duration_minutes: data.length || null,
      video_call_url: data.metadata?.videoCallUrl || null,
      calendar_success: data.appsStatus?.[0]?.success === 1,
      meet_success: data.appsStatus?.[1]?.success === 1,

      // Extracted
      email,
      subject,
      company,
      industry,
      use_case,
      website,
      meeting_time,
      meeting_link,
      contact_name
    }
  }
];

// Get HTML content from HTTP Request
const html = $input.first().json.data || '';

// Clean and normalize the text
const textOnly = html
  .replace(/<script[^>]*>[\s\S]*?<\/script>/gi, '')  // Remove script tags
  .replace(/<style[^>]*>[\s\S]*?<\/style>/gi, '')    // Remove style tags
  .replace(/<\/?[^>]+(>|$)/g, '')                    // Remove all HTML tags
  .replace(/\s+/g, ' ')                              // Replace multiple spaces with a single space
  .trim();                                           // Trim leading/trailing spaces

// Return plain text
return [
  {
    json: {
      plainText: textOnly
    }
  }
];

const data = items[0].json;

const results = data.organic_results || [];

// Keywords to identify useful results
const relevantKeywords = ['company profile', 'about', 'funding', 'investors', 'calendar productivity'];

// Extract and clean relevant results
const extracted = results
  .filter(r => {
    const title = (r.title || "").toLowerCase();
    const snippet = (r.snippet || "").toLowerCase();
    const link = (r.link || "").toLowerCase();

    // Exclude Cal.com and check if relevant
    return !link.includes('cal.com') &&
      relevantKeywords.some(keyword => title.includes(keyword) || snippet.includes(keyword));
  })
  .map(r => ({
    title: r.title?.trim() || null,
    description: r.snippet?.trim() || null,
    url: r.link || null,
    source_icon: r.favicon || null
  }));

return [
  {
    json: {
      company_name: "Loopin",
      total_results: extracted.length,
      company_profiles: extracted.length > 0 ? extracted : "No valid company data found."
    }
  }
];
